    dy[17] = -R[4][0] - Ir[4][1]*V[1][0] - Ir[4][2]*V[2][0] - Ir[4][3]*V[3][0] + Ir[1][0]*V[4][1] + Ir[2][0]*V[4][2] + Ir[3][0]*V[4][3] + Ir[4][0]*w[4][0];
    dy[18] = Rr[4][1]*V[1][0] + Rr[4][2]*V[2][0] + Rr[4][3]*V[3][0] - Rr[0][0]*V[4][0] + Rr[4][4]*V[4][0] - Rr[1][0]*V[4][1] - Rr[2][0]*V[4][2] - Rr[3][0]*V[4][3] - Rr[4][0]*w[4][0];
